import React from "react";
import { AreaChart, Area, YAxis, XAxis, CartesianGrid, Tooltip, Legend } from 'recharts';

class AreaRechartComponent extends React.Component {

    data = this.props.data
    type = this.props.type

    render() {
        return (
            <AreaChart width={730} height={250} data={this.data}
                       margin={{ top: 10, right: 30, left: 0, bottom: 0 }}>
                <defs>
                    <linearGradient id="colorUv" x1="0" y1="0" x2="0" y2="1">
                        <stop offset="5%" stopColor="#8ec1aa" stopOpacity={0.8} />
                        <stop offset="95%" stopColor="#8ec1aa" stopOpacity={0} />
                    </linearGradient>
                    <linearGradient id="colorPv" x1="0" y1="0" x2="0" y2="1">
                        <stop offset="5%" stopColor="#8ec1aa" stopOpacity={0.8} />
                        <stop offset="95%" stopColor="#8ec1aa" stopOpacity={0} />
                    </linearGradient>
                </defs>
                <XAxis dataKey="name" />
                <YAxis />
                <CartesianGrid strokeDasharray="3 3" />
                <Tooltip />
                <Legend />
                {this.type=="Temperature"?<Area type="monotone" dataKey="Temperature" stroke="#8ec1aa" fillOpacity={1} fill="url(#colorUv)" />
                :<Area type="monotone" dataKey="CO2" stroke="#8ec1aa" fillOpacity={1} fill="url(#colorUv)" />}

            </AreaChart>
        )
    };
}

export default AreaRechartComponent;
